class PurchaseProof extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            user: null,
        }
    }


    componentDidMount() {
        this.setState({user: localStorage.getItem('user')}, () => {console.log(this.state.user)})
    }

    render() {

        return (

            <div className="App" style={{scrollBehavior: "auto"}}>
                <div className="Purchase">
                    <h1>PURCHASE PAGE: </h1>
                    <h1>USER: {this.state.user}</h1>
                    <div class="dropdown">
                        <button class="dropbtn">Dropdown</button>
                        <div class="dropdown-content">
                            <a href="#">MasterCard</a>
                            <a href="#">Link 2</a>
                            <a href="#">Link 3</a>
                        </div>
                    </div>

                </div>
            </div>
        )
    }

}

export default withRouter(PurchaseProof)
